import React, { Component } from 'react'

class GameRoom extends Component {
  render () {
    return (
      <div>
        <h3>Room {this.props.id}</h3>
        {this.props.users.map(
          function(user) {
            return(<p>Player: {user.name}</p>)
          }
        )}
        <button><a href="#">Join</a></button>
      </div>
    )
  }
}

export default GameRoom
